var surveyData;function loadData(){$.ajax({type:"GET",url:"data/surveyData.json",dataType:"json",success:function(a){transportation(a.totals.transportation),surveyData=a},error:function(a){console.log("Error "+a.status),console.log(a)}})}function transportation(a){var s=a.titles,o=a.data,l=0,n=0,i=0,c=0,f=0;o.forEach(function(a,o){for(var r=0;r<a;r++){var e=s[o];if("Train"==e)l++;else if("Bus"==e)n++;else if("Car"==e)i++;else if("Walk"==e)c++;else if("Bike"==e)f++;else for(var t=e.split(",");r<t.length;r++)"Train"==t[0]?l++:"Bus"==t[0]?n++:"Car"==t[0]?i++:"Walk"==t[0]?c++:"Bike"==t[0]?f++:console.log("Invalid data")}});var r,e="fas fa-2x";for(r=0;r<l;r++)$("#trains").append($("<i class='"+e+" fa-subway'>"));for(r=0;r<n;r++)$("#buses").append($("<i class='"+e+" fa-bus'>"));for(r=0;r<i;r++)$("#cars").append($("<i class='"+e+" fa-car'>"));for(r=0;r<c;r++)$("#walks").append($("<i class='"+e+" fa-walking'>"));for(r=0;r<f;r++)$("#bikes").append($("<i class='"+e+" fa-bicycle'>"))}function drawChart(a){var o=google.visualization.arrayToDataTable([a]);new google.visualization.PieChart(document.querySelector(".left-top")).draw(o,{title:"Male & Female"})}google.charts.load("current",{packages:["corechart"]}),google.charts.setOnLoadCallback(drawChart),$(document).ready(function(){loadData()});